INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (63, 'Monitory LED', 'Monitor LED Dell U2312HM UltraSharp wyposażony w matrycę IPS o przekątnej 23 cali i rozdzielczości 1920×1080 pikseli, która zapewnia obraz najwyższej jakości. 4 porty USB oraz złącza DisplayPort, DVI i VGA umożliwiają łączność z wieloma rozmaitymi urządzeniami.', 4, 'DELL monitor LED U2312HM UltraSharp', 890);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (67, 'Monitory LED', 'Monitor Samsung LS24C450MW wyposażony w ekran o przekątnej 24" i rozdzielczości 1920×1200. Dzięki technologii Mega Dynamic Contrast gwarantuje niezwykle żywe kolory, ostrość wyświetlanych kształtów oraz jasność. Funkcja Magic Angle pozwala na oglądanie filmów pod dowolnym kątem.', 5, 'Samsung LS24C450MW (LS24C45KMW/EN)', 9909);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (71, 'Sprzęt AGD', 'ZANUSSI ZCG 560MW to model kuchni gazowo-elektrycznej przystosowany do niezależnej zabudowy. Kuchenka koloru białego o standardowych wymiarach 50 cm i 60 cm, pozwala dopasować ją do wybranej przestrzeni, a dzięki zastosowaniu najnowszych technologii jest to wybór bardzo ekonomiczny.', 70, 'Kuchnia ZANUSSI ZCG 560MW', 732.899999999999977);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (73, 'Sprzęt AGD', 'Lodówka RL55VJBIH to lodówka z zamrażalnikiem u dołu, która urzekła już nie jednego klienta. Jest ona idealnym rozwiązaniem dla osób, które potrzebują funkcję mrożenia i zależy im na większej przestrzeni do codziennego chłodzenia.', 5, 'Lodówka SAMSUNG RL55VJBIH', 2549);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (78, 'Sprzęt AGD', 'Okap AMICA OKC653SW to klasyczny model pochłaniacza wykonany w najnowszych technologiach. Nowoczesny design okapu idealnie wpisuje się w wolną zabudowę oraz jako moduł do kompletu mebli kuchennych.', 77, 'Okap AMICA OKC653SW', 1290);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (81, 'Sprzęt AGD', 'Pralka EWF1276GDW to ładowana od frontu i sterowany elektronicznie model, posiadający wiele przydatnych, zaawansowanych technologicznie, ale niezwykle prostych w użytkowaniu funkcji.', 80, 'Pralka ELECTROLUX EWF1276GDW', 1685);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (84, 'Słuchawki', 'Dzięki słuchawkom Philips możesz bezprzewodowo słuchać muzyki w domu. Dostrajają się one automatycznie, zapewniając najlepszy odbiór i doskonałe wrażenia podczas słuchania w domu.', 83, 'Philips SHC8535', 329.79000000000002);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (89, 'Słuchawki', 'Słuchawki nauszne Sony MDR-ZX600 wyposażone w przetworniki akustyczne o średnicy 40 mm, które zapewniają dźwięk najwyższej jakości. Pasmo w zakresie 6 – 25 000 Hz gwarantuje zachowanie wszelkich szczegółów odtwarzanego utworu.', 88, 'SONY MDR-ZX600B', 189.789999999999992);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (94, 'Telefony komórkowe', 'Smartfon Apple iPhone 5 wyposażony w zdumiewający wyświetlacz Retina o przekątnej 4" i rozdzielczości 1136×640 pikseli, który zapewnia niesamowity obraz najwyższej jakości. Nowy układ A6 gwarantuje najwyższą wydajność urządzenia.', 93, 'Apple iPhone 5, 16GB', 2699);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (102, 'Telefony komórkowe', 'Nokia Lumia, Czarna to Smartfon z dotykowym ekranem o przekątnej 3.8 cala oraz rozdzielczości 800×480 pikseli. Telefon posiada dwurdzeniowy procesor Snapdragon S4, 2 × 1 GHz. Dodatkowo telefon pracuje w oparciu o system operacyjny MS Windows Phone 8.', 101, 'Nokia Lumia 620', 1099);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (105, 'Telefony komórkowe', 'Smartphone Sony Xperia Z wyposażony w 5 calowy ekran o zdumiewającej rozdzielczości 1920×1080 pikseli. Czterordzeniowy procesor o taktowaniu 1,5 GHz gwarantuje doskonałą płynność działania urządzenia.', 88, 'SONY Xperia Z', 2890);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (109, 'Telewizory 3D', 'Telewizor LED 3D UE46F6500 marki Samsung posiada matrycę o przekątnej 46 cali oraz rozdzielczości Full HD. Dzięki funkcji korekcji obrazu możesz cieszyć się lepszą jakością odtwarzanych mediów.', 5, 'Samsung UE46F6500', 3890.19000000000005);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (113, 'Telewizory 3D', 'Telewizor 3D LED LG 47LM660S o przekątnej ekranu wynoszącej 47 cali. Technologia Cinema 3D eliminuje migotanie oraz zapewnia jaśniejszy i wyraźniejszy obraz 3D. Możliwość konwersji 2D do 3D pozwoli Ci obejrzeć ulubione filmy w zupełnie nowym wymiarze!', 112, 'LG 47LM660S', 3699);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (118, 'Telewizory 3D', 'Telewizor plazmowy 3D Panasonic VIERA TX-P65ST50E NeoPlasma o przekątnej ekranu wynoszącej 65 cali. Obraz 3D w rozdzielczości Full HD zapewnia niesamowite doznania wizualne.', 117, 'Panasonic VIERA TX-P65ST50E', 7199);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (122, 'Telewizory LCD', '', 83, 'PHILIPS 32PFL3008H/12', 999);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (125, 'Telewizory LCD', 'Telewizor LCD Samsung LE40D503 o przekątnej ekranu wynoszącej 40 cali. Rozdzielczość Full HD gwarantuje doskonałą szczegółowość obrazu, a funkcja Wide Color Enhancer zapewnia idealne odwzorowanie kolorów, tak aby obraz stał się jeszcze bardziej rzeczywisty!', 5, 'Samsung LE40D503', 1599);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (129, 'Telewizory LED', 'Telewizor LED Sony KDL-40R470 o przekątnej ekranu wynoszącej 40". Technologia Clear Resolution Enhancer poprawia czystość oraz zwiększa kontrast i odczucie głębi, dzięki czemu obraz staje się jeszcze bardziej rzeczywisty.', 88, 'SONY KDL-40R470', 2099);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (132, 'Telewizory LED', 'Telewizor LED LG 42LS570S o przekątnej ekranu wynoszącej 42 cale. Urządzenie posiad panel Home Dashboard będący najbardziej intuicyjnym, najłatwiejszym w obsłudze i dającym największe możliwości personalizacji interfejsem użytkownika.', 112, 'LG 42LS570S', 2149);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (136, 'Telewizory LED', 'Telewizor LED Samsung UE42F5500 o przekątnej ekranu wynoszącej 42 cale został wyposażony w funkcję Clean View, dzięki której emitowane programy telewizyjne są krystalicznie czyste. Technologia Wide Color Enhancer Plus oraz rozdzielczość Full HD gwarantują wyjątkową jakość wyświetlanych obrazów.', 5, 'Samsung UE42F5500', 2149.90000000000009);
INSERT INTO product (product_id, category_id, description, manufacturer_id, name, price) VALUES (49, 'Laptopy', '', 5, 'Samsung NP550P5C-S04PL 15,6" HD  i5-3210M 8GB 1TB', 2569);
